INSERT INTO `farm_products` (`id`, `name`, `type`, `description`, `sector_id`, `imgUrl`, `created_at`, `updated_at`) VALUES
(122, 'Bangus', 'crop', 'Bangus, or milkfish, is a tender, mildly flavored fish known for its rich, juicy meat. A staple in Filipino cuisine, it\'s perfect for grilling, frying, or cooking in savory dishes like sinigang and paksiw. Sustainably farmed and naturally nutritious, Bangus is a delicious source of protein and omega-3', 5, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1751009324/testUpload/r6lewyrxsmez5u1prfct.jpg', '2025-06-22 11:24:08', '2025-06-27 15:28:51'),
(123, 'Tilapia', 'crop', 'Tilapia', 5, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750752100/testUpload/kxivzarhzswmycu5l0xg.jpg', '2025-06-22 11:24:26', '2025-06-24 16:01:49'),
(124, 'Cow', 'crop', 'Cow', 4, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750751084/testUpload/tsamqu5pygxxlgthfbau.webp', '2025-06-22 11:24:35', '2025-06-24 15:59:56'),
(125, 'Pig', 'crop', 'Pig is a versatile livestock animal prized for its high-quality meat, including pork, bacon, ham, and more. Known for its fast growth and efficient feed conversion, pig farming supports a wide range of culinary and commercial uses, making it a valuable part of the livestock industry.', 4, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1751009416/testUpload/bdlic5teffgshgx15wzx.jpg', '2025-06-27 15:30:24', '2025-06-27 15:30:24'),
(126, 'Cattle', 'crop', 'Cattle are essential livestock raised for both meat and dairy production. Known for their adaptability and economic value, they provide high-quality beef, milk, leather, and other by-products that support global agriculture and food industries.', 4, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1751009583/testUpload/bywohj9add6kkmqviki4.jpg', '2025-06-27 15:33:07', '2025-06-27 15:33:07'),
(127, 'Horse', 'crop', 'Horses are strong, intelligent animals used for work, transport, and recreation. Valued in farming, sports, and tourism, horses also play a key role in cultural heritage and rural livelihoods.', 4, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1751009628/testUpload/uj1b8swjfhio0ajrdex7.png', '2025-06-27 15:33:53', '2025-06-27 15:33:53'),
(128, 'Rice', 'crop', 'A versatile staple grain, perfect for side dishes, stir-fries, and main courses. Naturally gluten-free and rich in energy.', 1, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1751010798/testUpload/ndsqmijchuvnxvhvwv7r.webp', '2025-06-27 15:53:21', '2025-06-27 15:53:21'),
(129, 'Corn', 'crop', 'Sweet and crunchy whole grain, ideal for boiling, grilling, or milling. Great in salads, soups, or as a healthy snack.', 2, NULL, '2025-06-27 15:53:42', '2025-06-27 15:53:42'),
(130, 'Cassava', 'crop', 'Cassava', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755358900/testUpload/rspzxd31sapfqinoknvc.jpg', '2025-06-27 15:54:32', '2025-08-16 15:41:44'),
(131, 'Pineapple', 'crop', 'A pineapple is a sweet tropical fruit with a tough leathery skin and spiky leaves on top. Pineapple is excellent, whether eaten as a snack, in a sweet dessert, in savory dishes like fried rice, or even on pizza.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244608/testUpload/drqe9x4m2zcu2lfgmfvf.webp', '2025-06-27 15:54:45', '2025-08-15 07:57:00'),
(132, 'Organic Something', 'crop', 'qwe', 6, 'https://example.com/default-product.jpg', '2025-06-27 16:05:00', '2025-06-27 16:06:02'),
(135, 'Oyster Mushroom', 'crop', 'Mushrrom', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1753897089/testUpload/vz7yxyszm6qejjj4cgvl.webp', '2025-07-31 01:38:13', '2025-07-31 01:38:13'),
(136, 'Shrimps', 'crop', 'hipon', 5, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1753898295/testUpload/jxmqxcj9crimsknmnyon.jpg', '2025-07-31 01:58:14', '2025-07-31 01:58:14'),
(137, 'Carpa', 'crop', 'carpa', 5, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1753898375/testUpload/m3lj9f2nfoeo5vtfjx2q.jpg', '2025-07-31 01:59:32', '2025-07-31 01:59:32'),
(138, 'Sampel', 'crop', 'sample', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1754625539/testUpload/o2v4ibmjeqdlrywnzlfe.jpg', '2025-08-08 03:59:02', '2025-08-08 03:59:02'),
(139, 'Lanzones', 'crop', 'Lanzones or Langsat are trees from the Mahogany family, scientifically known as Lansium parasiticum. It bears a small, tangy, sour, and sweet combination of edible fruits that are similar to potatoes on outer appearance, and inside they have white flesh containing inedible, bitter seeds.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244273/testUpload/bofg8i90mf3hebu2fdzp.jpg', '2025-08-15 07:51:16', '2025-08-15 07:51:16'),
(140, 'Rambutan', 'crop', 'Rambutans are a fruit native to Southeast Asia but now grown in other tropical climates. The taste is most often compared to that of grapes. Rambutans are a source of several important nutrients, including dietary fiber, vitamin C, and copper.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244343/testUpload/cl0m48bln9ioy0qoccrh.webp', '2025-08-15 07:52:26', '2025-08-15 07:52:26'),
(141, 'Banana', 'crop', 'Bananas are long, curved fruits with smooth, yellow, and sometimes slightly green skin. The average length of a banana is about 7 to 9 inches, and it is about 2 to 3 inches in diameter. The skin of the banana is usually yellow when it is ripe, but it can also be green, red, or purple depending on the variety.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244488/testUpload/ct8l4ghlr4o16jb017fv.webp', '2025-08-15 07:54:58', '2025-08-15 07:54:58'),
(142, 'Papaya', 'crop', 'Papaya is a melon-like fruit, which varies greatly in shape and size. The skin of unripe fruit is smooth, green, and thin and changes to deep orange or yellow when ripe. The flesh varies from 2.5 to 5.0 cm in thickness and yellow to orange in color.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244736/testUpload/tgo9yc53dnafemoq2pt9.webp', '2025-08-15 07:59:05', '2025-08-15 07:59:05'),
(143, 'Ampalaya', 'crop', 'Momordica charantia, commonly called bitter-melon or ampalaya, is a vigorous, tendril-bearing, frost tender, annual vine of the cucumber family that will grow rapidly to 12-20\' long in a single growing season. It is native to tropical and sub-tropical parts of Asia and Africa.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244861/testUpload/vp1brgaczhgvdvm4xizn.webp', '2025-08-15 08:01:05', '2025-08-19 13:49:50'),
(144, 'Eggplant', 'crop', 'The fruit is a large egg-shaped berry with a glossy surface that varies in colour from dark purple to red, pink, yellowish, or white and is sometimes striped; the colour and shape of the white variety is the source of the common', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755244953/testUpload/nulouji4mckisk1rqz2s.jpg', '2025-08-15 08:02:36', '2025-08-15 08:02:36'),
(145, 'Mustard', 'crop', 'Mustasa', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245077/testUpload/boputf5d9ukyy0fnlmfq.jpg', '2025-08-15 08:04:40', '2025-08-15 08:04:40'),
(146, 'Pechay', 'crop', 'It is known as one of the oldest vegetables in Asia; it therefore plays an important role in the Philippines\' economy as well as in the nutrition of the Filipino people.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245142/testUpload/q0mgtkhcvcgds3igx5of.webp', '2025-08-15 08:05:47', '2025-08-15 08:05:47'),
(147, 'Radish', 'crop', 'Radishes are root vegetables that belong to the cruciferae or mustard family. Their skins can be red, black, yellow, purple, and pink, and they have a spicy, peppery taste. This taste comes from enzymes that are also in mustard root, horseradish, and wasabi root. Cooking them makes the flavor milder.', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245191/testUpload/ii3uxcz711kmrennzaj2.webp', '2025-08-15 08:06:35', '2025-08-15 08:06:35'),
(148, 'Snap Beans', 'crop', 'Snap Bean', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245305/testUpload/fhaatsn5zvcangrczxmk.webp', '2025-08-15 08:08:27', '2025-08-15 08:12:36'),
(149, 'Squash', 'crop', 'Squash (Cucurbita maxima L.) locally known as ‚Äúkalabasa‚Äù is a popular vegetable among the Filipinos. The shoots, flowers and young fruits can be cooked as dinengdeng, bulanglang or saut√©ed with meat, fish or shrimps and mixed with other vegetables', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245438/testUpload/vsizzr8pffsclrriliow.webp', '2025-08-15 08:10:41', '2025-08-15 08:10:41'),
(150, 'String Bean', 'crop', 'String Bwan', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245591/testUpload/kjz9fbexa1vo1ielj9yy.jpg', '2025-08-15 08:13:14', '2025-08-15 08:13:14'),
(151, 'Upo', 'crop', 'Upo is called a bottle gourd in English because of its elongated shape. The plant has the scientific name Lagenaria siceraria. Its fruit is a very popular', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245667/testUpload/vmbk2shbmwjne5hqz7sz.jpg', '2025-08-15 08:14:29', '2025-08-15 08:14:29'),
(152, 'Ube', 'crop', 'also called ube ubi, purple yam, or greater yam, among many other names ‚Äì is a species of yam', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755245745/testUpload/qzrfdgjbfkhqz991dntq.jpg', '2025-08-15 08:15:47', '2025-08-15 08:15:47'),
