(154, 'Tomato', 'crop', 'The tomato Solanum lycopersicum, is a plant whose fruit is an edible berry that is eaten as a vegetable', 3, 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1755246155/testUpload/xxdraa3qvsad5inp6ya2.webp', '2025-08-15 08:22:37', '2025-08-15 08:22:37'),
