INSERT INTO `sectors` (`sector_id`, `sector_name`, `description`, `created_at`, `updated_at`, `mission`, `imgUrl`) VALUES
(1, 'Rice', 'Rice is a staple crop and a backbone of local agriculture. San Pablo City supports its rice farmers in adapting to climate change, improving yields, and maintaining stable supply for local consumption.', '2025-06-21 11:12:17', '2025-06-21 11:12:17', 'To ensure food security by increasing rice productivity through the promotion of climate-resilient farming practices, quality seed distribution, and efficient use of irrigation and post-harvest technologies.', 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750587072/rice_klcvuo.jpg'),
(2, 'Corn', 'Corn serves both as human food and livestock feed, making it a strategic crop in the city‚Äôs agricultural system. San Pablo is committed to enhancing its role in food chains and ensuring sustainable corn farming practices.', '2025-06-21 11:12:17', '2025-06-21 11:12:17', 'To boost corn production by introducing high-yield varieties, improving mechanization, and supporting smallholder farmers in accessing training, inputs, and markets.', 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750587073/corn_ohukal.jpg'),
(3, 'HVC', 'High-value crops such as vegetables, fruits, herbs, and ornamentals offer higher profitability per hectare. In San Pablo City, this sector creates opportunities for diversified income and encourages innovation in agri-entrepreneurship.', '2025-06-21 11:12:17', '2025-06-21 11:12:17', 'To strengthen the production and marketing of high-value crops by providing technical support, modern farming methods, and infrastructure that enable farmers to maximize income and competitiveness.', 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750587301/hvc_huuaeg.jpg'),
(4, 'Livestock', 'Livestock is a key source of food and income in San Pablo. With proper management and support, it contributes to food security and rural development, while also offering potential for agribusiness and value-added processing.', '2025-06-21 11:12:17', '2025-06-21 11:12:17', 'To enhance livestock production systems by improving animal health services, breeding programs, and farmer training to ensure sustainable, safe, and profitable meat and dairy production.', 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750587121/livestock_kfud7e.jpg'),
(5, 'Fishery', 'The city‚Äôs inland fishery sector plays a vital role in food supply and livelihood. Through sustainable fish farming and conservation of aquatic resources, San Pablo aims to ensure long-term productivity of lakes and rivers while uplifting its fishing communities.\n\n', '2025-06-21 11:12:17', '2025-06-21 11:12:17', 'To develop a sustainable and resilient fishery sector by enhancing freshwater aquaculture, protecting aquatic ecosystems, and improving the livelihoods of fisherfolk through training, access to resources, and market support.', 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750587073/fishery_hbvfep.webp'),
(6, 'Organic', 'Organic farming in San Pablo City focuses on natural and eco-friendly agricultural practices, eliminating the use of synthetic chemicals and promoting biodiversity. This approach helps protect soil health, water resources, and the well-being of both farmers and consumers.', '2025-06-21 11:12:17', '2025-06-21 11:12:17', 'To promote and support the widespread adoption of organic farming practices in San Pablo City, ensuring the production of safe, healthy, and sustainable food while preserving the integrity of the environment.', 'https://res.cloudinary.com/dk41ykxsq/image/upload/v1750587074/orgniac_rfjm0b.jpg');
